import { Injectable } from '@angular/core';
import { Receta } from 'src/app/pages/domain/receta';

@Injectable({
  providedIn: 'root'
})
export class RecetasService {
  private recetas: Receta[] = [];

  agregarReceta(receta: Receta) {
    this.recetas.push(receta);

  }

  obtenerRecetas() {
    return this.recetas;
  }
}
